description:
James and Grace Anderson take a vacation from their antiques business, only to find themselves the new owners of another shop! Help them save the store by collecting treasures and selling them for a tidy profit. Explore lush scenes from Montana, Wisconsin &amp; Louisiana and solve new, unique puzzles in this challenging Hidden Object game!

